import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (

            <header>

                <div id="banner" style={ myheader }>
<pre> {`
████████╗ █████╗ ███████╗ █████╗ ██╗     ██╗
╚══██╔══╝██╔══██╗██╔════╝██╔══██╗██║     ██║
   ██║   ███████║███████╗███████║██║     ██║
   ██║   ██╔══██║╚════██║██╔══██║██║     ██║
   ██║   ██║  ██║███████║██║  ██║███████╗██║
   ╚═╝   ╚═╝  ╚═╝╚══════╝╚═╝  ╚═╝╚══════╝╚═╝
   `}
</pre>
</div>


<div class="menu">
    <ul>
        <li><a href='/'>Home</a></li>
        <li><a href='/'>Projects</a></li>
        <li><a href='/'>Whoami</a></li>
    </ul>
</div>

</header>

        );
    }
}



const myheader = {
    fontSize: '20px'
  };





export default Header;
